import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import AuthPage from './pages/AuthPage';
import UserDashboard from './components/UserDashboard'; // ✅ NEW!
import Pages from './pages/Pages';
import Payments from './pages/Payments';
import Reports from './pages/Reports';
import Users from './pages/Users';
import Templates from './pages/Templates';
import { GoogleOAuthProvider } from '@react-oauth/google';
import ErrorBoundary from './components/ErrorBoundary';
import { UserProvider } from './context/UserContext';
import CreateLandingPage from './components/CreateLanding';
import GioiThieu from './components/about_public/GioiThieu';
import Contact from './components/about_public/Contact';
import PageAbout from './components/about_public/Pages ';
import Blog from './components/about_public/Blog';
import AdminAddTemplate from './components/AdminAddTemplate';
import Sidebar from './components/Sidebar'; // ✅ ADD!

function App() {
    const clientId = process.env.REACT_APP_GOOGLE_CLIENT_ID;

    return (
        <GoogleOAuthProvider clientId={clientId}>
            <ErrorBoundary>
                <Router>
                    <UserProvider>
                        <div className="app-container">
                            {/* ✅ SIDEBAR FOR PROTECTED ROUTES */}
                            <Routes>
                                {/* PUBLIC */}
                                <Route path="/public">
                                    <Route index element={<Navigate to="/public/gioithieu" replace />} />
                                    <Route path="gioithieu" element={<GioiThieu />} />
                                    <Route path="lienhe" element={<Contact />} />
                                    <Route path="pages" element={<PageAbout />} />
                                    <Route path="bai-viet" element={<Blog />} />
                                </Route>

                                {/* AUTH */}
                                <Route path="/auth" element={<AuthPage />} />
                                <Route path="/" element={<Navigate to="/auth" replace />} />

                                {/* PROTECTED - WITH SIDEBAR */}
                                <Route element={<div className="main-layout"><Sidebar role="user" /><div className="main-content"><Outlet /></div></div>}>
                                    <Route path="/dashboard" element={<UserDashboard />} /> {/* ✅ CREATOR DASH! */}
                                    <Route path="/pages" element={<Pages />} />
                                    <Route path="/pages/create" element={<CreateLandingPage />} />
                                    <Route path="/create-landing" element={<Navigate to="/pages/create" replace />} />
                                    <Route path="/templates" element={<Templates />} />
                                    <Route path="/payments" element={<Payments />} />
                                </Route>

                                {/* ADMIN - WITH SIDEBAR */}
                                <Route element={<div className="main-layout"><Sidebar role="admin" /><div className="main-content"><Outlet /></div></div>}>
                                    <Route path="/admin/dashboard" element={<UserDashboard />} />
                                    <Route path="/users" element={<Users />} />
                                    <Route path="/qltemplates" element={<AdminAddTemplate />} />
                                    <Route path="/reports" element={<Reports />} />
                                </Route>

                                {/* CATCH-ALL */}
                                <Route path="*" element={<Navigate to="/dashboard" replace />} />
                            </Routes>
                        </div>
                    </UserProvider>
                </Router>
            </ErrorBoundary>
        </GoogleOAuthProvider>
    );
}

export default App;
